const usersTheme = {
  paper: {
    borderRadius: '0'
  },
  button: {
    margin: '8px',
    backgroundColor: '#617D8B',
    color: '#fff'
  },
  lalala: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '24px 24px 0'
  },
  title: {
    fontSize: '1.5rem'
  },
  link: {
    textDecoration: 'none',
    color: '#fff'
  }
};

export default usersTheme;
